import React from "react";

function App() {
  return (
    <div
      style={{
        background: "radial-gradient(circle at center, #0a0a0a 0%, #000 80%)",
        minHeight: "100vh",
        color: "#FFD700",
        fontFamily: "Poppins, sans-serif",
        overflow: "hidden",
        position: "relative",
      }}
    >
      {/* Digital Grid Background */}
      <div
        style={{
          backgroundImage:
            "linear-gradient(rgba(255, 215, 0, 0.08) 1px, transparent 1px), linear-gradient(90deg, rgba(255, 215, 0, 0.08) 1px, transparent 1px)",
          backgroundSize: "40px 40px",
          position: "absolute",
          inset: 0,
          zIndex: 0,
        }}
      ></div>

      {/* Main Content */}
      <div
        style={{
          position: "relative",
          zIndex: 2,
          textAlign: "center",
          paddingTop: "100px",
        }}
      >
        {/* Logo */}
        <img
          src="/logo.png"
          alt="Target Marketing Logo"
          style={{ width: "120px", marginBottom: "20px" }}
        />

        {/* Title */}
        <h1
          style={{
            fontSize: "2.8rem",
            fontWeight: "700",
            textShadow: "0 0 20px #FFD700",
          }}
        >
          TARGET MARKETING ACADEMY
        </h1>

        {/* Subtitle */}
        <p
          style={{
            color: "#fff",
            fontSize: "1.3rem",
            marginTop: "10px",
            textShadow: "0 0 10px rgba(255,255,255,0.3)",
          }}
        >
          Innovation. Intelligence. Impact.
        </p>

        {/* Description */}
        <p
          style={{
            color: "#ccc",
            maxWidth: "750px",
            margin: "25px auto",
            lineHeight: "1.8",
          }}
        >
          A next-generation ecosystem merging{" "}
          <span style={{ color: "#FFD700" }}>marketing</span>,{" "}
          <span style={{ color: "#FFD700" }}>trading</span>, and{" "}
          <span style={{ color: "#FFD700" }}>AI</span> â€” powered by{" "}
          <b>GPS Systems</b>.
        </p>

        {/* Navigation Buttons */}
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            flexWrap: "wrap",
            gap: "15px",
            marginTop: "40px",
          }}
        >
          {[
            "GPS TRADING",
            "GPS MARKETING",
            "GPS DROPSHIPPING",
            "GPS LANGUAGES",
            "GPS STUDIO",
          ].map((item) => (
            <button
              key={item}
              style={{
                background:
                  "linear-gradient(135deg, #FFD700 0%, #b8860b 100%)",
                color: "#000",
                border: "none",
                borderRadius: "10px",
                padding: "14px 24px",
                fontWeight: "700",
                cursor: "pointer",
                boxShadow: "0 0 10px rgba(255,215,0,0.4)",
                transition: "0.3s",
              }}
              onMouseOver={(e) => {
                e.target.style.transform = "scale(1.08)";
                e.target.style.boxShadow =
                  "0 0 25px rgba(255,215,0,0.8)";
              }}
              onMouseOut={(e) => {
                e.target.style.transform = "scale(1)";
                e.target.style.boxShadow =
                  "0 0 10px rgba(255,215,0,0.4)";
              }}
            >
              {item}
            </button>
          ))}
        </div>
      </div>

      {/* Footer */}
      <footer
        style={{
          position: "absolute",
          bottom: "20px",
          width: "100%",
          textAlign: "center",
          color: "#777",
          fontSize: "0.9rem",
          zIndex: 2,
        }}
      >
        Â© 2025 Target Marketing Systems | Powered by GPS AI
      </footer>
    </div>
  );
}

export default App;
